function makeTree(prevLevel, levels) {
    if (levels <= 0)
        return;
    var curLevel = [];
    var   b2BodyDef = Box2D.Dynamics.b2BodyDef
        , b2Body = Box2D.Dynamics.b2Body;
    for (var j = 0; j < levels; j++){
        for(var i = 0; i < prevLevel.length; i++){
            if (i === 0)
                curLevel.push(this.createCircle(prevLevel[i].GetPosition().x - 0.4, prevLevel[i].GetPosition().y + 0.4, b2Body.b2_staticBody));
            curLevel.push(this.createCircle(prevLevel[i].GetPosition().x + 0.4, prevLevel[i].GetPosition().y + 0.4, b2Body.b2_staticBody));
        }
        prevLevel = curLevel;
        curLevel = [];
        if (j === levels - 1)
        {
            for(var k = 0; k < prevLevel.length; k++){
                this.createBox(prevLevel[k].GetPosition().x, prevLevel[k].GetPosition().y + 3, .1, 2.5, b2Body.b2_staticBody);
            }
        }    
    }
    this.binBounds = [];
    this.binBounds.push(0);
    for (var i = 0; i < prevLevel.length; i++){
        this.binBounds.push(prevLevel[i].GetPosition().x - 0.05);
    }
    this.binBounds.push(20);
    //show(this.binBounds.toString());
    prevLevel = null;
    curLevel = null;
}

