function analyze() {
    if (this.box2dWorld === null)
        return;

    var binCounts = [];
    binCounts.length = this.binBounds.length - 1;
    for (var i = 0; i < binCounts.length; i++)
        binCounts[i] = 0;

    for(var body = this.box2dWorld.GetBodyList(); body; body = body.GetNext())
    {
        if (body.m_type === 2) // 2 represents dynamicBody
        {
            for (var j = 0; j < binCounts.length; j++)
            {
                if (body.GetPosition().x >= this.binBounds[j] && body.GetPosition().x <= this.binBounds[j+1] && body.GetPosition().y >= 7)
                {
                    binCounts[j] += 1;
                }
            }
        }
    }
    show(binCounts.toString());
    binCounts = null;    
}

